import React from 'react';
import Tittle from '../Components/Tittle';
import ImageSection from '../Components/ImageSection';
import SkillsSection from '../Components/SkillsSection';

function AboutPage() {
    return (
        <div className="AboutPage">
            <Tittle title={'About Me'} span={' About Me'}/>
            <ImageSection />
            <Tittle title={'My Skills'} span={' My Skills'}/>
            <div className="skills-container">
                <SkillsSection skill={'Python'} progress={'85%'} width={'85%'}/>
                <SkillsSection skill={'Java'} progress={'70%'} width={'70%'}/>
                <SkillsSection skill={'Javascript'} progress={'60%'} width={'60%'}/>
                <SkillsSection skill={'Android'} progress={'65%'} width={'65%'}/>
                <SkillsSection skill={'React JS'} progress={'50%'} width={'50%'}/>
                <SkillsSection skill={'HTML & CSS'} progress={'80%'} width={'80%'}/>
            </div>
            <Tittle title={'Services'} span={'Services'} />
            <div className="servives-container">
                <ServicesSection image={design} title={'Web design'} 
                text={'Lorem ipsum dolor sit amet consectetur adipisicing elit.'}
                />
                <ServicesSection image={intelligence} title={'Artificial Intelligence'} 
                text={'Lorem ipsum dolor sit amet consectetur adipisicing elit.'}
                />
                <ServicesSection image={gamedev} title={'Game Development'} 
                text={'Lorem ipsum dolor sit amet consectetur adipisicing elit.'}
                />

                
            </div>
        </div>
    );
}

export default AboutPage;
